    return (
        <Modal
            show={show}
            onHide={onHide}
            size="lg"
            centered
        >
            <Modal.Header closeButton>
                <Modal.Title id="contained-modal-title-vcenter">
                    Добавить тип
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                {/* Здесь будет содержимое модального окна */}
            </Modal.Body>
        </Modal>
    );
};

export default CreateType;
